import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./pages/Headerimg/eci-systems-logo-143A9A4350-seeklogo.com.png";
function Header() {
  return (
    <div>
      <Container>
        <Row>
          <Col className="" lg={4}>
            <img src={img1} alt="" className="headerimg1" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Header;
